import React from 'react';

const AccountMain = () => {
    return (
        <>
            <h3><Link to={`${url}/login`}>Log in</Link></h3>
            <h3>Don't have an account? <Link to={`${url}/register`}>Register</Link></h3>
        </>
    );
}

export default AccountMain;
